import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Main from './components/Main';
import Footer from './components/Footer';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="main-content">
        <div className="row">
          <div className="column">
            {/* Primera columna: Datos del paciente */}
            <Main />
          </div>
          <div className="column">
            {/* Segunda columna: Botones */}
            <div className="button-container">
            <button type="button" >Mostrar Resultados</button>
            <button type="button">Descargar PDF</button>
            </div>
          </div>
          <div className="column">
            {/* Tercera columna: Resultados */}
            <div className="results-container">
              {/* Aqu√≠ muestra los resultados cuando sea necesario */}
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
